window.bookSummaryJSON = "Cate Fante is strong and smart, but when she gets appointed a federal judge, even she wonders if she can do the job justice. She's in her 30s, and she feels like she's joining the world's most exclusive retirement village. But Cate keeps her doubts a secret. And, as it happens, much else. For she leads a dark, double life that she hides from everyone. <p> Then a high-profile case in her courtroom explodes into a shocking murder-suicide, and it blasts her cover wide open. Overnight, her new career hangs in tatters. But Cate's troubles are only beginning. An enemy no one anticipated sends her running for her life, embarking on a journey that begins in the mystery of her own childhood. She'll have to fight her way back to the truth, or die trying.</p> <p> <i>Dirty Blonde</i> is Lisa Scottoline's most suspenseful and gripping thriller to date. Mixing poignancy with her trademark wit and wonderfully compelling characters, it questions whether law and justice are always the same thing. </p>"; 
